                                                <h1>""मण्डनदेउपुर नगरपालिकामा तपाईलाई स्वागत छ l""   </h1>
                                                <div class=""field-item even"" property=""content:encoded"">
                                                    <p>मण्डनदेउपुर नगरपालिका नेपालको बागमती प्रदेश अन्तर्गत काभ्रेपलाञ्चोक जिल्लामा अवस्थित छ। नेपालको राजधानि काठमाडौंबाट उत्तर-पूर्वमा ५५ कि.मि. दुरीमा रहेको यस नगरपालिकाको क्षेत्रफल ८९ वर्ग कि.मि. रहेको छ। यस नगरपालिका साविक&nbsp; बालुवापाटी देउपुर, गैरीवीसौना देउपुर,नयाँगाउँ देउपुर, महादेवस्थान मण्डन, चण्डेनी मण्डन, जैसीथोक मण्डन र ज्याम्दि मण्डन (१-४ , ६) गा.वि.स गरी सात गा.वि.स मिलेर सम्वत २०७३ साल फागुन २७ गते राजपत्रमा प्रकाशनपछि अ");
            WriteLiteral(@"स्तित्वमा आएको हो। यस नगरपालिकाको पूर्वमा भम्लु गाउँपालीका,पश्चिममा भक्तपुर र काठमाडौं, उत्तरमा सिन्धुपाल्चोक जिल्ला र दक्षिणमा बनेपा र पाँचखाल नगरपालिका रहेको छ।मध्यम पहाडी हावापानी भएको यस नगरपालिकालाई विभिन्न १२ वटा वडामा विभाजन गरिएको छ । यहाँको कुल जनसंख्या ३२,६५९ रहेको छ जसमा पु्रुष १५,३२० र महिला १७३३९ रहेका छन् साथै लैङ्गिक अनुपात ८८.३६ र जनघनत्व ३६७ प्रति वर्ग कि.मी. रहेको छ ।</p>
                                                    <p>यस नगरपालिकामा विशेष गरी हिन्दु, वौद्ध र इशाई धर्मावालम्वीहरुको बसोबास रहेको छ । यहाँ ब्राह्मण, क्षेत्री र तामाङ्ग जातिको बाहुल्यता रहेको छ । यहाँका नागरिकहरुले कृषि, पशुपालन र व्यापारलाई र पर्यटन व्यवसायलाई मुख्य पेशाको रुपमा अँगाल्दै आएका छन् । धुलिखेल, बनेपा र काठमाडौं उपत्यकाबाट नजिक रहेकोले यस नगरपालिकाको आर्थिक, सामाजिक तथा साँस्कृतिक विकासमा प्रत्यक्ष सकारात्मक प्रभाव परेको छ । यहाँ उत्पादन हुने कृषिजन्य तथा पशुजन्य उपजहरु तिनै बजार क्षेत्रमा बढी खपत र विक्री हुने गरेको छ । भौगोलिक रुपमा मध्यम स्तरीय पहाडी धरातल रहेको यस नगरमा मानव बसोबास र पर्यटन व्यवसायको लागि");
            WriteLiteral(@" अति उपयुक्त स्थानहरु रहेका छन् । मण्डनदेउपुर काभ्रे जिल्लाकै सबैभन्दा कान्छो नवगठित नगरपालिका भएकोले यसलाई एक सक्षम नगरपालिकाको रुपमा स्थापना गर्ने चुनौति&nbsp; समग्र नगरवासी तथा सरकारी र गैरसरकारी निकायहरुको काँधमा आई परेको छ । यहाँ भएका सम्भावनाहरुलाई अवसरको रुपमा परिणत गर्न र यहाँ रहेका समस्याहरुको न्यूनीकरण गर्ने क्रममा योजनावद्ध तवरबाट लाग्नु पर्ने आवश्यकता छ ।</p>
